-- ----------------------------
-- Table structure for tbl_pasarela
-- ----------------------------
CREATE TABLE `tbl_pasarela`  (
  `idPasarela` smallint NOT NULL AUTO_INCREMENT,
  `nombre` varchar(100) CHARACTER SET utf8 COLLATE utf8_spanish_ci NOT NULL,
  `tipo` char(1) CHARACTER SET latin1 COLLATE latin1_spanish_ci NOT NULL DEFAULT 'P' COMMENT 'P- pagos, T- transferencias, R- prueba',
  `cuenta` varchar(1500) CHARACTER SET utf8 COLLATE utf8_spanish_ci NULL DEFAULT NULL,
  `datos` varchar(1500) CHARACTER SET latin1 COLLATE latin1_spanish_ci NULL DEFAULT NULL COMMENT 'cadena separada por comas con los datos de la pasarela ver index.php',
  `fecha` int NOT NULL,
  `activo` tinyint(1) NOT NULL DEFAULT 1,
  `comercio` varchar(300) CHARACTER SET latin1 COLLATE latin1_spanish_ci NULL DEFAULT NULL,
  `imagen` varchar(60) CHARACTER SET latin1 COLLATE latin1_spanish_ci NULL DEFAULT NULL,
  `idcenauto` smallint NOT NULL COMMENT 'identificador del centro autorizador',
  `estado` char(1) CHARACTER SET latin1 COLLATE latin1_spanish_ci NOT NULL DEFAULT 'D' COMMENT 'P - produccion, D- desarrollo',
  `secure` tinyint(1) NOT NULL DEFAULT 0 COMMENT '0-no segura, 1-segura, 2-otros metodos de pago',
  `idbanco` smallint NOT NULL DEFAULT 1,
  `devolucion` tinyint(1) NOT NULL DEFAULT 0,
  `idempresa` tinyint NOT NULL DEFAULT 1,
  `LimMinOper` int NOT NULL DEFAULT 0,
  `LimMaxOper` int NOT NULL DEFAULT 100000000,
  `LimDiar` int NOT NULL DEFAULT 100000000,
  `LimMens` int NOT NULL DEFAULT 100000000,
  `LimAnual` int NOT NULL DEFAULT 100000000,
  `LimOperIpDia` int NOT NULL DEFAULT 100,
  `LimOperTarDia` int NOT NULL DEFAULT 100,
  `LimOperDia` int NOT NULL DEFAULT 500,
  `coefImporta` decimal(3, 2) NOT NULL DEFAULT 1.00 COMMENT 'coeficiente de importancia de pasarela, selecc pasarela intelig',
  `idagencia` int NULL DEFAULT NULL,
  `amex` tinyint(1) NOT NULL DEFAULT 0 COMMENT '0-no amex, 1-si amex',
  `observacion` tinytext CHARACTER SET latin1 COLLATE latin1_spanish_ci NULL,
  `fechamod` int NOT NULL,
  `usdxamex` int NOT NULL DEFAULT 0 COMMENT '0-no permite usd x amex, 1-permite usd x amex',
  `pasarLim` int NOT NULL DEFAULT 0 COMMENT 'pasarela sobre la que evalua los limites',
  PRIMARY KEY (`idPasarela`) USING BTREE,
  INDEX `activo`(`activo` ASC) USING BTREE,
  INDEX `idbanco`(`idbanco` ASC) USING BTREE,
  INDEX `idempresa`(`idempresa` ASC) USING BTREE,
  INDEX `idagencia`(`idagencia` ASC) USING BTREE,
  INDEX `amex`(`amex` ASC) USING BTREE,
  CONSTRAINT `tbl_pasarela_ibfk_1` FOREIGN KEY (`idbanco`) REFERENCES `tbl_bancos` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tbl_pasarela_ibfk_3` FOREIGN KEY (`idagencia`) REFERENCES `tbl_agencias` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tbl_pasarela_ibfk_4` FOREIGN KEY (`idempresa`) REFERENCES `tbl_empresas` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE
) ENGINE = InnoDB AUTO_INCREMENT = 248 CHARACTER SET = latin1 COLLATE = latin1_spanish_ci;

