  PRIMARY KEY (`id`) USING BTREE,
  INDEX `tipo`(`tipo` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 19 CHARACTER SET = utf8 COLLATE = utf8_spanish_ci;

